			Onze arrangementen

			&nbsp;
			Koffie en thee arrangement: &euro; 22,50&nbsp;per persoon per dag
			Gedurende de dag kunnen jullie onbeperkt gebruik maken van

			&nbsp;


				diverse soorten koffie, cappuccino, caff&egrave; latte, caff&egrave; macchiato

				&nbsp;

				diverse (verse) thee soorten&nbsp;
				&nbsp;

				karaffen met water gevuld met verse munt en citroen
				&nbsp;

				overheerlijke &amp; luxe koekjes en chocolade
				&nbsp;

				vers fruit dat op verzoek wordt aangesneden
				&nbsp;


			Uiteraard kunnen wij een breed assortiment aan andere drank aanbieden tegen een meerprijs en zullen we deze kosten op basis van nacalculatie doorberekenen.

			Lunch: &euro; 17,50 per persoon
			Het brood wordt in de ochtend vers afgebakken en wordt net voor lunchtijd gesneden zodat het heerlijk vers blijft.&nbsp;De broodjes worden rijkelijk belegd met: 

			&nbsp;


				biologische kipfilet

				&nbsp;

				biologische carpaccio
				&nbsp;

				gerookte zalm
				&nbsp;

				huisgemaakte makreelsalade
				&nbsp;

				huisgemaakte walnoten-tomatenspread met avocado, ei en groene asperges
				&nbsp;

				oude/jonge kaas
				&nbsp;


			De dranken bestaan uit biologische melk, vers geperste jus d&#39;orange &amp; biologische appelsap.

			Bovenstaande lunch kan worden uitgebreid met: 

			&nbsp;


				een huisgemaakte biologische soep van het seizoen &nbsp;(&euro; 5,50&nbsp;p.p.)

				&nbsp;

				huisgemaakte en biologische salades (&euro; 5,50&nbsp;p.p.)
				&nbsp;


			De soep en/of salade is alleen per groep te bestellen omdat deze speciaal gemaakt worden. Uiteraard verzorgen wij op verzoek ook vegan opties.

			Borrelarrangement
			Wij kunnen een borrelarrangement aanbieden voor slechts &euro; 15,- per persoon per uur. Tijdens dit borreluur kunnen jullie onbeperkt drinken. De keuze bestaat uit diverse soorten frisdrank, een heerlijke biologische rode wijn/ros&eacute;/witte wijn &amp; bier.
			Daarnaast presenteren wij diverse hapjes. Uiteraard kunnen wij ook drank en/of een (gezonde) snack zoals een verse smoothie of een kaasplankje serveren.&nbsp;De kosten hiervoor worden op basis van nacalculatie berekend. 

